import "./styles.css"

const InputFeild = () =>{
    return <form className='TaskBox'>

    <button  className="BezPracownika"><a href="">Zadania Bez Pracownika</a></button>
    <button  className="ZPracownikiem"><a href="">Zadania Z Pracownikiem</a></button>
    <button  className="Dodaj"><a href="">Dodaj</a></button>

    </form>
}

export default InputFeild;
